import React from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import '../css/App.css';
import Registrar from './Registrar';

export default function Navegation(){
        return (
            <Router>
                <div class="Menu">
                    <Link to="/"><button>Registrarse</button></Link>
                    <Link to="/Loggin"><button >Ingresar</button></Link>
                </div>        
                <Switch>
                    <Route path="/"><Registrar/></Route>
                    <Route path="/Loggin">{console.log(`click en Registrar`)}</Route>
                    {console.log(`ingreso por aca`)}
                </Switch>
                <div className="Title">
                    <h1>Presupuesto Personal</h1>
                </div>
            </Router>
        )
}
